// Dashboard.jsx
import React from "react";

function Dashboard() {
  return (
    <div style={{ padding: "50px" }}>
      <h1>Dashboard</h1>
      <p>Here you can see your events, guests, tasks, expenses, and items.</p>
    </div>
  );
}

export default Dashboard;
